import React from "react";
import ModuleItem from './ModuleItem'
export default class ModuleListComponent extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      module: {
        id: -1,
        titile: 'New Module'
      }
    };
  }

  render() {

      console.log(this.props.modules)

    return (
        <div>
            <ul className="list-group">
            <li className="list-group-item">
                <input  type="text" value={this.state.module.titile} className="form-control"/>
                <button className="badge-danger"></button>
            </li>
            {
                this.props.modules.map(module =>
                    <ModuleItem  module={module} key ={module.id}/>
                 )
            }
            </ul>
        </div>
    )
  }
}
